import React from "react";
import {useEffect} from "react";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import {getDogs} from "../../redux/actions/actions"
import { Link } from "react-router-dom";
import Card from '../CARD/Card'



 function Home() {
    const dispatch = useDispatch()
    const dogs= useSelector((state)=>state.dogs)

    useEffect(()=>{
        dispatch(getDogs())
    },[])


    function handleClick(event){
    event.preventDefault()
    dispatch(getDogs())
    }


    return (
        <div>
           <Link to='/dogs'>Create Breed</Link> 
           <h1>We Love Dogs</h1>
           <button onClick={event => {handleClick(event)}}>
           Show me all the dog breeds again!
           </button>
           <div>
             <select>
                <option value= "asc">Ascending</option> 
                <option value= "desc">Descending</option>
             </select>
                <option value= "temps">Temperaments</option>
                <option value= "ori">Origin</option> 
                <div className="containerDogs">
                {Array.isArray(dogs) ? (dogsMostrados.length ? dogsMostrados?.map(dog => {
                    return (
                        <Card 
                            key= {dog.id}
                            id = {dog.id}
                            name = {dog.name}
                            image = {dog.image}
                            weight = {dog.weight}
                            height = {dog.height}
                            age = {dog.age}
                            temperaments = {dog.temperaments}
                            temperament = {dog.temperament}
                            createInDb = {dog.createInDb}
                        />
                    );
                }) : <Loader />) : <div className="home404">{dogs.msg}</div>}
            </div>
           </div>
        </div>
    )
}
export default Home;
